import React, { Fragment } from 'react';
import { Helmet, HelmetProvider } from "react-helmet-async";


function Contact() {
    return (
        <Fragment>
      <HelmetProvider>
        <Helmet>
          <title> FAQs | Zom - IN </title>
        </Helmet>
      </HelmetProvider>
      <div id="faq" className="faq">
        </div>
        </Fragment>
    )
}

export default Contact
